import React, { Component } from 'react';
import './App.css';
import AccordionContainer from './containers/AccordionContainer'
import Logo from './components/Logo'

class App extends Component {
  render() {
    return (
      <div className="App">
  		<div class="row">
			<div class="col-4">
      			<Logo />
      		</div>
		</div>
      	<div class="row">
      		<div class="col-12">

        			<AccordionContainer title={ 'Customer Information'}/>
        	</div>
        </div>
      </div>
    );
  }
}

export default App;
